import {BrowserRouter as Router, Route} from "react-router-dom";
import Navbar from "./components/Navbar";

function App() {
  return (

   <Router>

    <Navbar/>
      <Route path="/">
        <h1>HOME</h1>
      </Route>

      <Route path="/note">
      <h1>HOME</h1>
      </Route>

      <Route path="/create">
      <h1>HOME</h1>
      </Route>

   </Router>
  );
}

export default App;
